import React from 'react'
import { BroswerRouter, Switch, Route } from 'react-router-dom'
import Home from './pages/home'
import About from './pages/about'

const App = () => {
  return (
    <BroswerRouter>
     <Switch>
       <Route path='/' exact component={Home}></Route>
       <Route path='/about' exact>
         <About />
       </Route>
     </Switch>
    </BroswerRouter>
  );
}

export default App;
